import ReactDOM from 'react-dom';

function Hello(){
	return <h1>Hello, Welcome to react app function!</h1>
}
const Hello_comp = <Hello />;

class HelloClass extends React.Component {
	constructor(props){
		super(props);
			this.state = {
				msg: "Hello, This is a react state object!"
			}
	}
	render(){
		return <h1>{this.state.msg} inside the react app class!</h1>;
	}
}

